// Dependencies.
import React from 'react';

// Component 'IntroRibbon'.
function AboutMe() {
    return (
        // IntroRibbon Container.
        <>
            {/* Desktop Ribbon */}
            <div id="section2" class="container-fluid">
                A bit about me
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
